import React from "react";

class Play extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      nameOne: "",
      nameTwo: "",
      selectOneX: false,
      selectOneO: false,
      selectTwoX: false,
      selectTwoO: false,
      selectPage: true,
    };
  }

  render() {
    return (
      <div className="play">
        <div className="userName">
          <label>Name</label>
        </div>
        <div className="newGames">
          <button>New Games</button>
        </div>
        <div className="userName">
          <label>Name</label>
        </div>
      </div>
    );
  }
}
export default Play;
